import SchoolIcon from '@mui/icons-material/School';
import WorkHistoryIcon from "@mui/icons-material/WorkHistory";
import "./Resume.css";
import CustomTimeline, {
    CustomTimelineSeparator,
} from "../../components/Timeline/Timeline";
import React from "react";
import { Grid, Typography } from "@mui/material";
import resumeData from "../../utils/resumeData";
import {
    TimelineConnector,
    TimelineContent,
    TimelineItem,
    TimelineSeparator,
} from "@mui/lab";
import TimelineDot from "@mui/lab/TimelineDot";

const Resume = () => {
    return (
        <>
        <Grid container className="section pb_45">
        <Grid item className="section_title bottom_30">
        <Typography variant="h6" className="section_title_text">
        About me
        </Typography>
        </Grid>
        <Grid item xs={12}>
        <Typography variant="body2" className="aboutme_text">
        {resumeData.about_me}
        </Typography>
        </Grid>
        </Grid>
        <Grid container className="section"></Grid>
        <Grid item className="section_title bottom_30">
        <Typography variant="h6" className="section_title_text">
        Resume
        </Typography>
        <Grid item xs={12}>
        <Grid container className="resume_timeline">
  <Grid item xs={12} md={6}>
    <CustomTimeline title="Work history" icon={<WorkHistoryIcon />}>
      {resumeData.workhistory.map((history) => (
        <TimelineItem>
          <CustomTimelineSeparator />
          <TimelineContent>
            <Typography variant="h6" className="timeline_title">
              {history.title}
            </Typography>
            <Typography variant="caption" className="timeline_date">
              {history.date}
            </Typography>
            <Typography variant="body2" className="timeline_description">
              {history.description}
            </Typography>
          </TimelineContent>
        </TimelineItem>
      ))}
    </CustomTimeline>
  </Grid>
  <Grid item xs={12} md={6} justifyContent='flex-end'>
    <CustomTimeline title="Education" icon={<SchoolIcon />}>
      {resumeData.education.map((edu) => (
        <TimelineItem>
          <CustomTimelineSeparator />
          <TimelineContent>
            <Typography variant="h6" className="timeline_title">
              {edu.title}
            </Typography>
            <Typography variant="caption" className="timeline_date">
              {edu.date}
            </Typography>
            <Typography variant="body2" className="timeline_description">
              {edu.description}
            </Typography>
          </TimelineContent>
        </TimelineItem>
      ))}
    </CustomTimeline>
  </Grid>
</Grid>
        </Grid>
        </Grid>
        </>
    );
};

export default Resume;
